import React from 'react'
import { useRouter, Router } from 'next/router'

export default function oneVacation() {
  const router = useRouter()
  const linkClickHandler = () => {
    Router.push('/JobOpenings')
  }
  return (
    <React.component>
      <h2>Vacation {router.query.id}</h2>
      {/*<button onClick={linkClickHandler}>Back<button/>*/}
    </React.component>
  )
}
